import React from 'react';
import {Icon} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';
import config from '../components/config/defaultblueprint.json';




const SocialIcon2=()=>{
    const output:any=[];

    const myStyle={
        margin: "0px 15px"
    }

     const socialicon:any[]=[{
       icon:"facebook-square",
       url:"https://www.facebook.com",
       color:" #3b5998",
       target:"_blank"
    },
    {
       icon:"linkedin-square",
       url:"https://in.linkedin.com/",
       color:"white",
       target:"_blank"
    },
    {
       icon:"twitter-square",
       url:"https://twitter.com/?lang=en",
       color:"#00acee",
       target:"_blank"
    },
    {
       icon:"pinterest-square",
       url:"https://in.pinterest.com/",
       color:"red",
       target:"_blank"
    }
]


    const getSocialIcons=()=>{
      Array.isArray(config.companyInfo.socialicon) && config.companyInfo.socialicon.forEach((items)=>{
        output.push(<a href={items.url} target={items.target} style={{color:items.color }}>
             <Icon icon={items.icon} size="2x" style={myStyle} />
            </a>)
      })
      return output;
    }

    return(
        <div>
   {getSocialIcons()}
        </div>
    )
}

export default SocialIcon2;
